start_filament_gcode:
"; Filament gcode
{local pressure_advance = 0.030}
{if printer_notes=~/.*DUPLICATOR_MODE.*/}
M572 D0:1 S{pressure_advance}
M98 P{"{directories.system^\"/System Macros/Change Settings/adjust_filament_monitor_sensitivity.g\"
}"
} D0 L65 H120
M98 P{"{directories.system^\"/System Macros/Change Settings/adjust_filament_monitor_sensitivity.g\"
}"
} D1 L65 H120
{else}
M572 D{current_extruder} S{pressure_advance}
M98 P{"{directories.system^\"/System Macros/Change Settings/adjust_filament_monitor_sensitivity.g\"
}"
} D{current_extruder} L65 H120
{endif}"
